import React from "react";
import {
    Card, CardMedia, Button, CardHeader,
    Typography, Divider, Grid, CardContent
} from '@material-ui/core/';


class Header extends React.Component {
    render() {
        const { qtdWishes, title } = this.props;
        return (
            <Card raised>
                <CardContent>
                    <Grid container>
                        <Grid item md={8} xs={12}>
                            <Typography variant="h4" component="h1">
                                {title}
                            </Typography>
                        </Grid>
                    </Grid>
                </CardContent>
            </Card >
        );
    }
}

export default Header;
